import React from 'react'

const Test4 = () => {
    let a = 100;
    let demo = ()=>{
        console.log("*********")
    }
  return (
    <>
    <div className="container my-4">
        <div className="row">
            <div className="col-md-12">
                <h1>Welcome</h1>
                <h1>{a}</h1>
                <br />
                <button onClick={demo} className='btn btn-info'>OK</button>
            </div>
        </div>
    </div>
    </>
  )
}

export default Test4
